import style from './MainContentRegister.module.css';

const MainContentRegister = () => {

    const doRegistr = async () => {
       const response =  await response ('http://localhost:3000/api/users/registr', 'POST', { fullName: `Eva`, email: `ttz@ttz.by`, password: `11111111111` })
        console.log(response);
    }
    return (
        <main className={style['MainContentRegister']}>
            <div className={style['MainContentRegister-info']}>
                <div className={style['MainContentRegister-signIn']}>
                    <div className={style['MainContentRegister-txt']}>Already have an account?</div>
                    <div className={style['MainContentRegister-btn']}> Sign In</div>

                    <div className={style['MainContentRegister-txt-welcome']}>
                        <div className={style['MainContentRegister-txt-welcomeTO']}> Welcome to </div>
                        <div className={style['MainContentRegister-txt-hschool']}> Hschool </div>
                    </div>
                </div>
            </div>


            <div className={style['MainContentRegister-form']}>

                <input placeholder='FullName' />
                <input placeholder='Email Adress' />
                <input placeholder='password' />
                <input placeholder='password' />
                <div className={style['MainContentRegister-form-button']} onClick>Continue</div>
            </div>

        </main>
    )
}

export default MainContentRegister;
